import { BsSearch } from 'react-icons/bs';

function Searchbar()
{
  return (
    <>
      <div class="input-group-prepend">
        <div class="input-group-text" id="btnGroupAddon">@</div>
      </div>
      <input type="text" class="form-control" placeholder="Input group example" aria-label="Input group example" aria-describedby="btnGroupAddon"></input>



    </>
  );
}

export default Searchbar;
